import { metaThemeDefault } from './themes/index.mjs';
import { resolveMetaThemeRefs } from './themes/utils.mjs';

var metadata = resolveMetaThemeRefs(metaThemeDefault);
/**
 * Identity function that simply returns the provided tokens with metadata, but additionally
